def get_lobcder_id(destination, ticket):
    destination = os.path.join('/Physiomespace',destination)
    results = requests.get( LOBCDER_REST%destination, headers={ 'Content-Type':'application/json', 'Accept':'application/json' }, auth=('admin',ticket),verify=False).json()
    if type(results['logicalDataWrapped']) == list:
        return results['logicalDataWrapped'][0]['logicalData']['uid']
    else:
        return results['logicalDataWrapped']['logicalData']['uid']

def get_lobcder_global_id(destination, ticket):
    destination = os.path.join('/Physiomespace',destination)
    results = requests.get( LOBCDER_REST%destination, headers={ 'Content-Type':'application/json', 'Accept':'application/json' }, auth=('admin',ticket),verify=False).json()
    if type(results['logicalDataWrapped']) == list:
        return results['logicalDataWrapped'][0]['globalID']
    else:
        return results['logicalDataWrapped']['globalID']

def set_lobcder_permission(id, ticket, permission):
    result = requests.put(LOBCDER_REST_PERMISSION%id, data=permission ,headers={  'Content-Type':'application/json', 'Accept':'application/json' }, auth=('admin',ticket), verify=False,)
    if result.status_code >= 200 and result.status_code < 300:
        return True
    return False

def upload_file_in_dav(ticket, source, destination):
    try:
        dest = os.path.join(LOBCDER_ROOT,destination)
        webdav = easywebdav.connect(LOBCDER_HOST, LOBCDER_PORT, username='admin', password=ticket, protocol = 'https')
        webdav.upload(source, dest)
        if webdav.exists(dest):
            return True
        return False
    except Exception:
        if webdav.exists(dest):
            return True
        return False


def mkdir_in_dav(ticket, destination):
    try:
        dest = os.path.join(LOBCDER_ROOT,destination)
        webdav = easywebdav.connect(LOBCDER_HOST, LOBCDER_PORT, username='admin', password=ticket, protocol = 'https')
        webdav.mkdir(dest)
        if webdav.exists(dest):
            return True
        return False
    except Exception:
        if webdav.exists(dest):
            return True
        return False

